import{_ as e,c as a,o,R as r}from"./chunks/framework.Z8Yta_7P.js";const m=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"ecosystem/faq.md","filePath":"ecosystem/faq.md"}'),t={name:"ecosystem/faq.md"},i=r('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><p>Welcome to the FAQ page.</p><p>Here, we&#39;ve compiled a list of frequently asked questions to help you find quick answers to common queries. If your question is not addressed here, feel free to reach out to our support channels for further assistance.</p><p>Absolutely! Here are 20 frequently asked questions (FAQ) about your open-source project, a REST API framework:</p><h2 id="what-is-the-purpose-of-your-rest-api-framework" tabindex="-1">What is the purpose of your REST API framework? <a class="header-anchor" href="#what-is-the-purpose-of-your-rest-api-framework" aria-label="Permalink to &quot;What is the purpose of your REST API framework?&quot;">​</a></h2><p>Axe API is a TypeScript-based Node.js framework designed to eliminate the need for repetitive tasks associated with common elements while allowing developers to focus on custom logic. It offers a comprehensive structure for your API, including numerous features and best practices that will save you time.</p><p>Axe API simplifies the development process of your API by taking care of basic tasks such as routing, validating, querying, and handling HTTP requests.</p><p>This feature allows developers to focus on custom logic while developing their Axe API projects, which results in faster development times.</p><h2 id="how-can-i-install-your-rest-api-framework" tabindex="-1">How can I install your REST API framework? <a class="header-anchor" href="#how-can-i-install-your-rest-api-framework" aria-label="Permalink to &quot;How can I install your REST API framework?&quot;">​</a></h2><p>To create a new Axe API project, the axe-magic CLI can be utilized.</p><p><a href="/learn/bookstore-api.html#step-1-installing-cli">Installing CLI</a></p><h2 id="what-features-does-your-rest-api-framework-offer-for-authentication-and-authorization" tabindex="-1">What features does your REST API framework offer for authentication and authorization? <a class="header-anchor" href="#what-features-does-your-rest-api-framework-offer-for-authentication-and-authorization" aria-label="Permalink to &quot;What features does your REST API framework offer for authentication and authorization?&quot;">​</a></h2><p>Axe API doesn&#39;t provide an internal authentication system. We thought that it should be flexible as possible.</p><p>Nevertheless, <a href="/learn/authentication.html">in this section</a>, we are going to show you how to create an authentication mechanism in Axe API.</p><h2 id="can-i-integrate-third-party-libraries-or-tools-with-your-rest-api-framework" tabindex="-1">Can I integrate third-party libraries or tools with your REST API framework? <a class="header-anchor" href="#can-i-integrate-third-party-libraries-or-tools-with-your-rest-api-framework" aria-label="Permalink to &quot;Can I integrate third-party libraries or tools with your REST API framework?&quot;">​</a></h2><p>Absolutely! Our framework is designed to be extensible, allowing seamless integration with various libraries and tools.</p><h2 id="how-do-i-handle-errors-and-exceptions-in-my-api-built-with-your-framework" tabindex="-1">How do I handle errors and exceptions in my API built with your framework? <a class="header-anchor" href="#how-do-i-handle-errors-and-exceptions-in-my-api-built-with-your-framework" aria-label="Permalink to &quot;How do I handle errors and exceptions in my API built with your framework?&quot;">​</a></h2><p>Axe API provides an error handler in all Axe API projects as default.</p><p><a href="/learn/error-handling.html#error-handler">Error handler documentation</a></p><h2 id="is-there-a-built-in-database-support-in-your-rest-api-framework" tabindex="-1">Is there a built-in database support in your REST API framework? <a class="header-anchor" href="#is-there-a-built-in-database-support-in-your-rest-api-framework" aria-label="Permalink to &quot;Is there a built-in database support in your REST API framework?&quot;">​</a></h2><p>Axe API uses <a href="https://knexjs.org/" target="_blank" rel="noreferrer">knex.js</a> for database operations.</p><p>Axe API supports all database that is supported by Knex.js;</p><ul><li>PostgreSQL: <code>pg</code></li><li>CockroachDB: <code>pg</code></li><li>MSSQL: <code>tedious</code></li><li>MySQL: <code>mysql</code></li><li>MariaDB: <code>mysql</code></li><li>SQLite3: <code>sqlite3</code></li><li>Better-SQLite3: <code>better-sqlite3</code></li><li>Oracle: <code>oracledb</code></li><li>Amazon Redshift: <code>pg</code></li></ul><h2 id="can-i-deploy-my-api-built-with-your-framework-to-a-cloud-service" tabindex="-1">Can I deploy my API built with your framework to a cloud service? <a class="header-anchor" href="#can-i-deploy-my-api-built-with-your-framework-to-a-cloud-service" aria-label="Permalink to &quot;Can I deploy my API built with your framework to a cloud service?&quot;">​</a></h2><p>Absolutely! Our framework is cloud-agnostic, and you can deploy your API to popular cloud services such as AWS, Azure, etc.</p><p>You can use the <a href="/learn/deployment.html#deployment">Deployment</a> documentation.</p><h2 id="how-can-i-contribute-to-the-development-of-your-rest-api-framework" tabindex="-1">How can I contribute to the development of your REST API framework? <a class="header-anchor" href="#how-can-i-contribute-to-the-development-of-your-rest-api-framework" aria-label="Permalink to &quot;How can I contribute to the development of your REST API framework?&quot;">​</a></h2><p>Check out our <a href="/learn/contribution.html">Contribution Guidelines</a> for information on how to contribute, report issues, and submit pull requests.</p><h2 id="is-your-rest-api-framework-suitable-for-large-scale-applications" tabindex="-1">Is your REST API framework suitable for large-scale applications? <a class="header-anchor" href="#is-your-rest-api-framework-suitable-for-large-scale-applications" aria-label="Permalink to &quot;Is your REST API framework suitable for large-scale applications?&quot;">​</a></h2><p>Yes, our framework is designed to scale, and it&#39;s suitable for both small-scale projects and large enterprise applications.</p><h2 id="are-there-any-code-examples-or-sample-projects-available-for-learning-purposes" tabindex="-1">Are there any code examples or sample projects available for learning purposes? <a class="header-anchor" href="#are-there-any-code-examples-or-sample-projects-available-for-learning-purposes" aria-label="Permalink to &quot;Are there any code examples or sample projects available for learning purposes?&quot;">​</a></h2><p>Yes, explore our <a href="https://github.com/axe-api/bookstore" target="_blank" rel="noreferrer">Bookstore API</a> for code snippets and sample projects to help you get started quickly.</p><h2 id="how-often-is-your-rest-api-framework-updated-and-how-can-i-stay-informed-about-new-releases" tabindex="-1">How often is your REST API framework updated, and how can I stay informed about new releases? <a class="header-anchor" href="#how-often-is-your-rest-api-framework-updated-and-how-can-i-stay-informed-about-new-releases" aria-label="Permalink to &quot;How often is your REST API framework updated, and how can I stay informed about new releases?&quot;">​</a></h2><p>We strive to provide regular updates. Follow us on <a href="/upgrading/versioning-policy.html">Versioning Policy</a> for information about new releases and updates.</p><h2 id="can-i-customize-the-api-documentation-generated-by-your-framework" tabindex="-1">Can I customize the API documentation generated by your framework? <a class="header-anchor" href="#can-i-customize-the-api-documentation-generated-by-your-framework" aria-label="Permalink to &quot;Can I customize the API documentation generated by your framework?&quot;">​</a></h2><p>Since Axe API already <strong><em>analyzes</em></strong> all of your models, routes, validations, etc, it is able to create your API documentation automatically.</p><p>Axe API supports the <a href="https://www.openapis.org" target="_blank" rel="noreferrer">OpenAPI</a> format with the <a href="https://swagger.io/docs/specification/about/" target="_blank" rel="noreferrer">Swagger interface</a>.</p><p>You can customize the documentation structure if you wish. Axe API uses OpenAPI v3 specification.</p><p>Explore our <a href="/learn/documentation.html#customization">Documentation Customization</a> documentation to get help.</p><h2 id="how-do-i-handle-versioning-of-apis-created-with-your-framework" tabindex="-1">How do I handle versioning of APIs created with your framework? <a class="header-anchor" href="#how-do-i-handle-versioning-of-apis-created-with-your-framework" aria-label="Permalink to &quot;How do I handle versioning of APIs created with your framework?&quot;">​</a></h2><p>Learn about API versioning in our <a href="/learn/version-management.html">Version management</a>, which provides guidelines for managing API versions effectively.</p>',41),s=[i];function n(l,u,h,d,p,c){return o(),a("div",null,s)}const w=e(t,[["render",n]]);export{m as __pageData,w as default};
